import React from "react";
import { DateObject } from "../../../types";

type DateLabelProps = {dateToDisplay: DateObject}

const DateLabel: React.FC<DateLabelProps> = ({dateToDisplay}) => {

  if (!dateToDisplay){
    return (
      <div>
        <p>N/A</p>
      </div>
    )
  } 

  return (
    <div>
      <p></p>
      {dateToDisplay.month ? (<p>{dateToDisplay.month}</p>) : null}
      {dateToDisplay.date ? (<p>{dateToDisplay.date}, </p>) : null}
      {dateToDisplay.year ? (<p>{dateToDisplay.year} </p>) : null}
    </div>
  )
}

export default DateLabel;
